import{_ as i,r as n,o as r,c,a as t,b as e,d as o,e as h}from"./app.b8a6a7c7.js";const d={},s=t("h1",{id:"support",tabindex:"-1"},[t("a",{class:"header-anchor",href:"#support","aria-hidden":"true"},"#"),e(" Support")],-1),l=t("h2",{id:"where-do-i-find-my-api-key",tabindex:"-1"},[t("a",{class:"header-anchor",href:"#where-do-i-find-my-api-key","aria-hidden":"true"},"#"),e(" Where do I find my API Key?")],-1),p={href:"https://platform.openai.com/account/api-keys",target:"_blank",rel:"noopener noreferrer"},u={href:"https://makersuite.google.com/app/apikey",target:"_blank",rel:"noopener noreferrer"},y=h('<h2 id="how-can-i-check-if-the-ai-configuration-i-entered-is-working-correctly" tabindex="-1"><a class="header-anchor" href="#how-can-i-check-if-the-ai-configuration-i-entered-is-working-correctly" aria-hidden="true">#</a> How can I check if the AI configuration I entered is working correctly.</h2><p>Open CatPaw app, click &#39;AI Service&#39;, click the &quot;Test&quot; button below the settings interface to verify if the configuration you filled in is correct.</p><h2 id="how-do-i-switch-my-default-keyboard-to-catpaw" tabindex="-1"><a class="header-anchor" href="#how-do-i-switch-my-default-keyboard-to-catpaw" aria-hidden="true">#</a> How do I switch my default keyboard to CatPaw?</h2><p>To switch to the CatPaw Keyboard:</p><p>Tap and hold the üåê keyboard key Select CatPaw If you don&#39;t see CatPaw on the keyboard list, you need to enable it in settings:</p><ul><li>Go to the Settings app</li><li>Scroll down and select CatPaw</li><li>Select Keyboards</li><li>Enable CatPaw and Allow Full Access</li></ul><p>If you don&#39;t see &#39;CatPaw&#39; in Settings, you need to restart the Settings app: swipe up from the bottom of the screen, swipe left or right to find the app, then swipe up on the app&#39;s preview to close it. Alternatively, restart your device.</p><p>If at some point you deleted CatPaw and would like to install it again:</p><p>Go to the Settings app Tap General -&gt; Keyboard -&gt; Keyboards Tap Add New Keyboard Select CatPaw and toggle Allow Full Access</p><h2 id="i-m-being-asked-to-allow-full-access-what-is-it" tabindex="-1"><a class="header-anchor" href="#i-m-being-asked-to-allow-full-access-what-is-it" aria-hidden="true">#</a> I&#39;m being asked to &quot;Allow Full Access,&quot; what is it?</h2><p>Granting Full Access simply allows the keyboard to connect to the internet. Without it, you can still use the keyboard to type, but all AI features won&#39;t be available. CatPaw Keyboard is privacy-first by design, as it cannot access password or credit card fields and does not collect any data.</p><h2 id="can-i-use-catpaw-without-paying" tabindex="-1"><a class="header-anchor" href="#can-i-use-catpaw-without-paying" aria-hidden="true">#</a> Can I use CatPaw without paying?</h2><p>Yes, you can! The free version grants you access to nearly all features with daily limits. The Pro membership provides unlimited access to everything.</p><h2 id="what-is-magictype-and-how-do-i-use-it" tabindex="-1"><a class="header-anchor" href="#what-is-magictype-and-how-do-i-use-it" aria-hidden="true">#</a> What is MagicType and how do I use it?</h2><p>MagicType utilizes AI&#39;s error correction ability to understand your input intent even if you enter incorrect letters. Please click on the ü™Ñ icon in the top right corner of the CatPaw keyboard. An input box will appear above the keyboard. Simply input long sentences quickly, and you can ignore punctuation. If you input incorrect letters or their order, please ignore them as well. After completing your input, click the &quot;Generate&quot; button in the bottom right corner of the keyboard. The AI will recognize your input and fill it into the text box.</p><h2 id="how-do-i-switch-between-the-magictype-input-box-and-my-regular-text-input-box" tabindex="-1"><a class="header-anchor" href="#how-do-i-switch-between-the-magictype-input-box-and-my-regular-text-input-box" aria-hidden="true">#</a> How do I switch between the MagicType input box and my regular text input box?</h2><p>In MagicType mode, you can click the toggle button to the left of the spacebar on the CatPaw keyboard to switch between input boxes. You can also manually click on the input box to switch to the template input box. To exit MagicType mode, click the ü™Ñ button in the top right corner of the keyboard again.</p><h2 id="how-to-create-custom-ai-commands" tabindex="-1"><a class="header-anchor" href="#how-to-create-custom-ai-commands" aria-hidden="true">#</a> How to create custom AI commands?</h2><p>If you&#39;re on the keyboard interface, you can click on the menu button in the top right corner of the CatPaw keyboard to open the custom command panel. Then, click on the plus icon ‚ûï to navigate to the creation interface of the CatPaw app. Alternatively, on the CatPaw app home page, click on &quot;AI commands&quot; and then click on the plus icon ‚ûï in the top right corner to create a command.</p><h2 id="how-to-write-an-ai-command-prompt" tabindex="-1"><a class="header-anchor" href="#how-to-write-an-ai-command-prompt" aria-hidden="true">#</a> How to write an AI command prompt?</h2><p>You can make your commands dynamic with placeholders. The Command will replace placeholder as follows. The supported placeholders are:</p><table><thead><tr><th>Placeholder</th><th>Description</th></tr></thead><tbody><tr><td>{full}</td><td>All text content in the text box.</td></tr><tr><td>{selection}</td><td>The selected text content in the text box.</td></tr><tr><td>{before}</td><td>The text content before the cursor.</td></tr><tr><td>{after}</td><td>The text content after the cursor.</td></tr><tr><td>{clipboard}</td><td>The text content in the clipboard.</td></tr><tr><td>{option}</td><td>The option you have selected.</td></tr></tbody></table><p>‚ö†Ô∏è Note: If you use {selection}: you will not be able to use {full}. Also, due to system limitations, {before}, {after}, and {selection} may not return the entire content in some cases.</p><p>Example:</p><blockquote><p>Prompt: Translate this sentence into <code>{option}</code>: <code>{full}</code></p></blockquote><blockquote><p>Options: English, Chinese</p></blockquote><p>When execute the command. CatPaw will replace the <code>{option}</code> with the option you have selected and the <code>{full}</code> with the text content in the text box.</p><h2 id="what-is-creativity" tabindex="-1"><a class="header-anchor" href="#what-is-creativity" aria-hidden="true">#</a> What is Creativity?</h2><p>Creativity is essentially the temperature parameter. Lower values of temperature, result in more consistent outputs, while higher values, generate more diverse and creative results. When selecting a temperature value, consider the desired balance between coherence and creativity for your specific application.</p><h2 id="still-need-help" tabindex="-1"><a class="header-anchor" href="#still-need-help" aria-hidden="true">#</a> Still Need Help?</h2><p>Contact Support: <a href="mailto:zhiguistudio@gmail.com">zhiguistudio@gmail.com</a></p>',31);function w(m,b){const a=n("ExternalLinkIcon");return r(),c("div",null,[s,l,t("p",null,[e("You can find your OpenAi API key in your "),t("a",p,[e("OpenAi User settings"),o(a)]),e(". To use the Gemini API, create a key in "),t("a",u,[e("Google AI Studio"),o(a)]),e(".")]),y])}const g=i(d,[["render",w],["__file","support.html.vue"]]);export{g as default};
